// src/components/Home.js
import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div className="bg-gray-50">
      {/* Navbar */}
      <nav className="bg-blue-600 p-4">
        <div className="max-w-7xl mx-auto flex justify-between items-center text-white">
          <h1 className="text-2xl font-bold">Jedidah Nzila</h1>
          <ul className="flex space-x-6">
            <li><Link to="/about" className="hover:text-blue-200">About</Link></li>
            <li><Link to="/projects" className="hover:text-blue-200">Projects</Link></li>
            <li><Link to="/contact" className="hover:text-blue-200">Contact</Link></li>
            <li><a href="/cv.pdf" className="hover:text-blue-200" download>Download CV</a></li>
          </ul>
        </div>
      </nav>

      {/* Hero Section */}
      <section className="h-screen bg-gradient-to-r from-blue-600 to-blue-400 text-white flex justify-center items-center">
        <div className="text-center">
          <h2 className="text-4xl font-bold">Welcome to My Portfolio</h2>
          <p className="mt-4 text-xl">I'm a passionate developer with a love for building impactful software.</p>
          <Link to="/projects" className="mt-8 inline-block text-white py-2 px-6 bg-blue-800 rounded-full hover:bg-blue-700">See My Work</Link>
        </div>
      </section>
    </div>
  );
}

export default Home;
